import React from 'react';
import brisecLogo from '../../../assets/images/Brigadier_logo2.jpg';
import classes from './Logo.module.css';

const Logo = (props) => {
    return (
        <div className={classes.Logo}>
            <img src={brisecLogo} alt="Brigadier Security"/>
        </div>
    );
};

export default Logo;
